import "isomorphic-fetch"

export function postWriting(paragraph) {
	console.log(paragraph);
    return fetch(`http://localhost:3001/api/addText`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ paragraph }) 
    })
}
